import axios from 'axios'

class AxiosRoutes {
    constructor() {
        this.baseUrl = 'http://localhost:5000'
    }

    async postUsers(params, data) {
        const request = await axios.post(`${this.baseUrl}${params}`, data)

        console.log(request.data)
    }
}

export default new AxiosRoutes()
